import React from 'react';
import './Login.scss';

function Login(props) {
    return (
        <div className="login">
            <div className="login__container margin-left-2">
                <div className="login__header">LOGIN</div>
                <div>
                    <input type="text" className="login__input margin-top-8" placeholder="Username" />
                </div>
                <div>
                    <input type="text" className="login__input margin-top-4" placeholder="Password" />
                </div>
                <div className="row">
                    <div class="col-xs-6 col-sm-6 margin-top-4 text-left">
                        <input type="checkbox" class="form-check-input" id="rememberCheck" />
                        <label class="form-check-label" for="rememberCheck">Remember me</label>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Login;
